import React from 'react';
import './Header.css';
import {Link} from 'react-router-dom';
import CategoriesList from '../CategoriesList/CategoriesList';
import SearchPanel from '../SearchPanel/SearchPanel';
import ContactUs from '../ContactUs/ContactUs'

class Header extends React.Component {
    state = {
        searchResults: []
    }
    onSearch = (value) => {

    }
    render(){
        const categories = ['covid-19', 'political', 'sport', 'art'];
        return (
            <header className='pt-4 pb-4 d-flex justify-content-between align-items-center'>
                <div className='pl-3' >
                    <h1 className='m-0 text-left home_link'>
                        <Link to='/'>News App</Link>
                    </h1>
                </div>
                <div className='d-flex justify-content-between pr-2 align-items-center'>
                    <CategoriesList
                        direction='row'
                        categories={categories}
                    />
                    <SearchPanel
                        onSearch={this.onSearch}
                        searchResults={this.state.searchResults}
                    />
                    <ContactUs />
                    <div className=''>
                        <Link
                            className='btn logout_button'
                            to='/logout'>
                            Logout
                        </Link>
                    </div>
                </div>

            </header>
        )
    }
}

export default Header;
